import zlib
import pickle
import base64

serialized = b''
obj = pickle.loads(zlib.decompress(base64.standard_b64decode(serialized)))


def row_length(i):
    return int(i * i / 4) + 1


n, k = map(int, input().split())
if k % 2 != 0 or k // 2 + 1 > row_length(n):
    ans = 0
else:
    accum = 0
    for i in range(1, n):
        accum += row_length(i)
    ans = obj[accum + k // 2]
print(ans)
